using System;
using System.Collections.Generic;
using System.Text;
using Xamarin.Forms;
using XLabs.Forms.Controls;
using XLabs.Serialization.JsonNET;

namespace formsapp2
{
	public partial class TravelogueDetailPage : ContentPage
	{
        Travelogue log;
        HybridWebView webView;

        public TravelogueDetailPage(Travelogue travelogue)
        {
            log = travelogue;
            Title = travelogue.getTitle();
            InitializeComponent();

            webView = new XLabs.Forms.Controls.HybridWebView(new JsonSerializer())
            {
                VerticalOptions = LayoutOptions.FillAndExpand,
                HorizontalOptions = LayoutOptions.FillAndExpand,
            };

            makePage();
            Button btn_add = new Button
            {
                Text = "Add new entry"
            };
            Button btn_remove = new Button
            {
                Text = "Remove entry"
            };
            btn_remove.Clicked += Btn_remove_Clicked;
            btn_add.Clicked += Btn_add_Clicked;
            Content = new StackLayout
            {
                Children = { webView,
                btn_add,
                btn_remove
                }
            };
        }

        /// <summary>
        /// go to a new page
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void Btn_add_Clicked(object sender, EventArgs e)
        {
            Navigation.PushAsync(new AddEntryPage(log));
        }

        /// <summary>
        /// remove an entry from a traveklogue
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private async void Btn_remove_Clicked(object sender, EventArgs e)
        {
            if (log != null)
            {
                List<string> items = new List<string>();
                foreach (LogEntry entry in log.getEntries())
                {
                    items.Add(entry.ToString());
                }
                var action = await DisplayActionSheet("Remove:", "Cancel", null, items.ToArray());
                foreach (LogEntry entry in log.getEntries().ToArray())
                {
                    if (action == entry.ToString())
                    {
                        log.removeEntry(entry);
                        makePage();
                    }
                }
            }
        }
        protected override void OnAppearing()
        {
            base.OnAppearing();
            makePage();
            
        }
        /// <summary>
        /// make a HtmlWebSource with stringbuilder and use the source in a webview
        /// </summary>
        public void makePage() {
            StringBuilder sb = new StringBuilder();
            string linebreak = "<br/><br/>";
            sb.Append("<html>");
            sb.Append("<body> ");
            //for each entry?
            if (log.getEntries().Count != 0)
            {
                int count = 0;
                foreach (LogEntry entry in log.getEntries())
                {
                    count++;
                    sb.Append("<p style='font-family:verdana;'><b>Entry " + count + ": " + entry.getTitle() +"</b>"+ linebreak);
                    sb.Append(entry.getContent()+ linebreak);
                    if (entry.getMedia().Count != 0)
                    {
                        sb.Append("attachment: <br/> <ul style='list-style-type:none'>" );
                        foreach (Media media in entry.getMedia())
                         {

                            //  string testbase64 = "";

                            if (media.getExt() == "img")
                            {
                                sb.Append("<li><img src=\"data:image/jpg;base64," + media.getBase64() + "\"/> </li>");
                            }
                            else if (media.getExt() == "vid")
                            {
                                sb.Append("<video width='400' height='225' controls> <source type='video/mp4' src = 'data:video/mp4;charset=utf-8;'" + media.getBase64() + " ></video>");
                            }
                       }
                    }
                    sb.Append("</ul></p>" + linebreak );
                }
            }
            else
            {
                sb.Append("No entries yet :(");
            }

            sb.Append("</body>");
            sb.Append("</html>");
            webView.Source = new HtmlWebViewSource { Html = sb.ToString() };
        }
    }
}

